    if identifier ~= nil then
        MySQL.Async.insert("INSERT INTO gksphone_job_message (`name`, `number`,`message`, `photo`, `gps`, `owner`, `jobm`) VALUES(@name, @number, @message, @photo, @gps, @owner, @jobm)", {
